export const AUTH_CHANCHE_LOGIN = 'AUTH_CHANCHE_LOGIN';
export const AUTH_CHANCHE_SESSION = 'AUTH_CHANCHE_SESSION';

export const setLogin = (login) => ({
    type: AUTH_CHANCHE_LOGIN,
    payload: login
});

export const setSession = (session) => ({
    type: AUTH_CHANCHE_LOGIN,
    payload: session
})
